--
-- Name: ome_nextval(character varying, integer); Type: FUNCTION; Schema: public; Owner: moore
--

CREATE FUNCTION ome_nextval(seq character varying, increment integer) RETURNS bigint
    LANGUAGE plpgsql
    AS $$
DECLARE
      nv   int8;
      sql  varchar;
BEGIN
      SELECT next_val INTO nv FROM seq_table WHERE sequence_name = seq FOR UPDATE OF seq_table;
      IF nv IS NULL THEN
          nv = increment;
      ELSE
          UPDATE seq_table SET next_val = (nv + increment) WHERE sequence_name = seq;
	  nv = nv + increment - 1;
      END IF;

      RETURN nv;
END;$$;


